const msalConfig = {
  auth: {
    clientId: 'gen-lang-client-0461138008',
    authority: 'https://login.microsoftonline.com/common',
    redirectUri: 'http://localhost:3000',
  },
  cache: {
    cacheLocation: 'localStorage',
    storeAuthStateInCookie: false,
  }
};

export default msalConfig;
